-- ----------------------------
-- Function structure for getChildrenOrg
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildrenOrg`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getChildrenOrg`(orgid INT) RETURNS varchar(4000) CHARSET utf8mb4
BEGIN
DECLARE oTemp VARCHAR(4000);
DECLARE oTempChild VARCHAR(4000);
 
SET oTemp = '';
SET oTempChild = CAST(orgid AS CHAR);
 
WHILE oTempChild IS NOT NULL
DO
SET oTemp = CONCAT(oTemp,',',oTempChild);
SELECT GROUP_CONCAT(id) INTO oTempChild FROM organization WHERE FIND_IN_SET(parent_id,oTempChild) > 0;
END WHILE;
RETURN oTemp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getParentOrg
-- ----------------------------
DROP FUNCTION IF EXISTS `getParentOrg`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getParentOrg`(orgid int) RETURNS varchar(4000) CHARSET utf8mb4
BEGIN
	DECLARE oTemp VARCHAR(4000);
	DECLARE oTempParent VARCHAR(4000);
	SET oTemp = '';
	SET oTempParent = CAST(orgid AS CHAR);
	WHILE oTempParent IS NOT NULL
		DO
		SET oTemp = CONCAT(oTemp,',',oTempParent);
		SELECT GROUP_CONCAT(parent_id) INTO oTempParent FROM organization WHERE FIND_IN_SET(id,oTempParent) > 0;
		END WHILE;
	RETURN oTemp;
END
;;
DELIMITER ;
